import Axios from 'axios';
import React from 'react';
import './App.css';

function App() {
  Axios({
    method: 'get',
    url: 'https://localhost:8080/chat/rooms',
    responseType: 'stream'
  })
    .then(function (response) {
      response.data.pipe(fs.createWriteStream('ada_lovelace.jpg'))
    });
  return (
    <div className="App">
        hello
    </div>
  );
}

export default App;
